--
-- Name: generate_code(text, integer); Type: FUNCTION; Schema: public; Owner: ils_admin
--

CREATE FUNCTION public.generate_code(prefix text, padding_size integer) RETURNS text
    LANGUAGE plpgsql
    AS $$
DECLARE
    current_year TEXT := TO_CHAR(CURRENT_DATE, 'YY');
    v_composite_key TEXT;
    next_sequence INT;
BEGIN

    IF prefix IS NULL OR prefix = '' THEN
        RAISE EXCEPTION 'Prefix cannot be null or empty';
    END IF;

    IF padding_size IS NULL OR padding_size < 1 THEN
        RAISE EXCEPTION 'Padding size must be greater than or equal to 1';
    END IF;

    BEGIN
        PERFORM 1
        FROM information_schema.tables
        WHERE table_schema = 'public' AND table_name = 'code_sequences';

        IF NOT FOUND THEN
            EXECUTE 'CREATE TABLE IF NOT EXISTS public.code_sequences (
                composite_key TEXT PRIMARY KEY,
                last_value INT NOT NULL
            )';
        END IF;
    EXCEPTION
        WHEN OTHERS THEN
            RAISE EXCEPTION 'Error creating or validating table: %', SQLERRM;
    END;

    v_composite_key := FORMAT('%s-%s', prefix, current_year);

    SELECT last_value
    INTO next_sequence
    FROM code_sequences
    WHERE composite_key = v_composite_key;

    IF NOT FOUND THEN
        next_sequence := 1;
        VALUES (v_composite_key, next_sequence);
    ELSE

        next_sequence := next_sequence + 1;
        UPDATE code_sequences
        SET last_value = next_sequence
        WHERE composite_key = v_composite_key;
    END IF;

    RETURN FORMAT('%s-%s-%s', prefix, current_year, LPAD(next_sequence::TEXT, padding_size, '0'));
END;
$$;


